var comida;
var calendario = $('#datetimepicker4');
calendario.datetimepicker({
  ignoreReadonly: true,
  format: 'dddd, LL',
  date: new Date
});

function calcular(items, name, unit) {
  var sum = 0;
  $.each(items, (index, value) => {
    var item = $(value).data();
    if (!item.hasOwnProperty(name) || isNaN(item[name])) return;
    var sugerida = (isNaN(item.sugerida)) ? numericQuantity(item.sugerida) : Number(item.sugerida);
    sum += (Number(item[name]) / sugerida) * Number(item.info.porciones);
  });
  sum = Number.isInteger(sum) ? sum : Number(sum).toFixed(2);
  $(`td[name=${name}]`).text(`${sum} ${unit}`);
}

function calcular2(data, field) {
  var sum = 0;
  $.each(data, (i, comida) => {
    $.each(comida, (j, alimento) => {
      var item = database[alimento.comida];
      if (!item.hasOwnProperty(field) || isNaN(item[field])) return;
      var porciones = alimento.porciones;
      var sugerida = (isNaN(item.sugerida)) ? numericQuantity(item.sugerida) : Number(item.sugerida);
      sum += (Number(item[field]) / sugerida) * Number(porciones);
    })
  });
  return sum;
}

$('#showstats').on('click', function () {
  lineChart.data.datasets[0].data = [];
  var dia = calendario.datetimepicker('date').startOf('day').startOf('week');
  var data = JSON.parse(localStorage.getItem('data')) || [];
  chartData = {
    energia: [], proteina: [], lipidos: [], hidratoscarbono: [], sodio: [], potasio: [], fosforo: [], calcio: [], selenio: [], hierro: [], agua: []
  };
  for (let i = 0; i < 7; i++) {
    var index = dia.unix();
    if (data.hasOwnProperty(index)) {
      chartData['energia'].push(calcular2(data[index], 'energiakc'));
      chartData['proteina'].push(calcular2(data[index], 'proteina'));
      chartData['lipidos'].push(calcular2(data[index], 'lipidos'));
      chartData['hidratoscarbono'].push(calcular2(data[index], 'hidratoscarbono'));
      chartData['sodio'].push(calcular2(data[index], 'sodio'));
      chartData['potasio'].push(calcular2(data[index], 'potasio'));
      chartData['fosforo'].push(calcular2(data[index], 'fosforo'));
      chartData['calcio'].push(calcular2(data[index], 'calcio'));
      chartData['selenio'].push(calcular2(data[index], 'selenio'));
      chartData['hierro'].push(calcular2(data[index], 'hierro'));
      chartData['agua'].push(calcular2(data[index], 'agua'));
    } else
      $.each(chartData, item => {
        chartData[item].push(0);
      });

    dia.add(1, 'days');
  }
  $('#rb1').click().trigger('change');
  $('#stats').modal();
});

$("input[name=options]").on('change', function () {
  lineChartData.datasets[0].data = chartData[this.value];
  if (!chartData[this.value]) console.error(this.value);
  lineChart.update();
});

$('#allday').on('click', function () {
  var items = $('div.card').find('div.card-body').children();
  calcular(items, 'energiakc', 'kcal');
  calcular(items, 'proteina', 'g');
  calcular(items, 'lipidos', 'g');
  calcular(items, 'hidratoscarbono', 'g');
  calcular(items, 'sodio', 'mg');
  calcular(items, 'potasio', 'mg');
  calcular(items, 'fosforo', 'mg');
  calcular(items, 'calcio', 'mg');
  calcular(items, 'selenio', 'mg');
  calcular(items, 'hierro', 'mg');
  calcular(items, 'agua', 'ml');
  $('#titulo-tiempo').html('<i class="fas fa-flask"></i> Totales por el día');
  $('#count').modal();
});

$('#comidas').on('click', 'button[name=add]', function (evt) {
  comida = $(this).attr('data');
  //$('#categoria').val('');
  //$('#alimento').empty();
  alimentos.val(null).trigger('change');
  $('#porciones').val('');
  $('#unidades').text('');
  btnAgregarAlimento.attr('disabled', true);
  $('#frmAddMeal').modal();
}).on('click', 'button[name=remove]', function () {
  var btn = $(this)
  var itemsHolder = btn.parents('div.card-body');
  comida = btn.parents('div.card-body').attr('name');
  btn.parents('div.callout').remove();
  var items = itemsHolder.children();
  var dia = calendario.datetimepicker('date').startOf('day').unix();
  var data = localStorage.getItem('data');
  if (!data) data = {}; else data = JSON.parse(data);
  var ddata = data[dia];
  if (!ddata) ddata = { desayuno: [], cmatutina: [], comida: [], cvespertina: [], cena: [] };

  ddata[comida] = [];

  $.each(items, function (i, v) {
    ddata[comida].push($(v).data().info)
  });

  data[dia] = ddata;

  localStorage.setItem('data', JSON.stringify(data));
}).on('click', 'button[name=count]', function () {
  var items = $(this).parents('div.card').find('div.card-body').children();
  calcular(items, 'energiakc', 'kcal');
  calcular(items, 'proteina', 'g');
  calcular(items, 'lipidos', 'g');
  calcular(items, 'hidratoscarbono', 'g');
  calcular(items, 'sodio', 'mg');
  calcular(items, 'potasio', 'mg');
  calcular(items, 'fosforo', 'mg');
  calcular(items, 'calcio', 'mg');
  calcular(items, 'selenio', 'mg');
  calcular(items, 'hierro', 'mg');
  calcular(items, 'agua', 'ml');
  $('#titulo-tiempo').html($(this).attr('data'));
  $('#count').modal();
});

var alimentos = $('#alimento').select2({ placeholder: 'Selecciona una opción', theme: 'bootstrap4', language: 'es' }).on('change', function () {
  if (!this.value) return;
  btnAgregarAlimento.attr('disabled', false);
  var alimento = $(this).find(':selected').data();
  var sugerida = (isNaN(alimento.sugerida)) ? numericQuantity(alimento.sugerida) : alimento.sugerida;
  $('#porciones').val(sugerida);
  $('#unidades').text(alimento.unidad);
}).on('select2:open', function () {
  $('input.select2-search__field').attr('placeholder', 'Escribe aquí para buscar')[0].focus()
});

var btnAgregarAlimento = $('#btnAgregarAlimento').on('click', function () {
  var dia = calendario.datetimepicker('date').startOf('day').unix();

  var selMeal = {
    comida: $('#alimento').val(),
    porciones: $('#porciones').val()
  };

  var data = localStorage.getItem('data');
  if (!data) data = {}; else data = JSON.parse(data);
  var ddata = data[dia];
  if (!ddata) ddata = {
    desayuno: [],
    cmatutina: [],
    comida: [],
    cvespertina: [],
    cena: []
  };

  ddata[comida].push(selMeal);
  data[dia] = ddata;

  localStorage.setItem('data', JSON.stringify(data));

  var meal = database[selMeal.comida];
  meal.info = selMeal;

  $("div[name=" + comida + "]").append(
    $('<div class="callout callout-info">').append(
      $('<button class="close" type="button" name="remove">×</button>')
    ).append(
      $('<h5>').text(meal.alimento)
    ).append(
      $('<p>').append(
        $('<div class="input-group">')
          .append(
            $(`<input type="number" class="form-control" value="${selMeal.porciones}">`)
          ).append(
            $('<div class="input-group-append">').append(
              $('<span class="input-group-text"></span>').text(meal.unidad)
            )
          )
      )
    ).data(meal)
  );
  $('#frmAddMeal').modal('hide');
});

$('div#comidas').on('change', 'input[type=number]', function () {
  var input = $(this);
  if (isNaN(input.val())) return;
  var itemsHolder = input.parents('div.card-body');
  comida = input.parents('div.card-body').attr('name');

  var selData = input.parents('div.callout').data();
  selData.info.porciones = input.val();
  input.parents('div.callout').data(selData);

  var items = itemsHolder.children();
  var dia = calendario.datetimepicker('date').startOf('day').unix();
  var data = localStorage.getItem('data');
  if (!data) data = {}; else data = JSON.parse(data);
  var ddata = data[dia];
  if (!ddata) ddata = { desayuno: [], cmatutina: [], comida: [], cvespertina: [], cena: [] };

  ddata[comida] = [];

  $.each(items, function (i, v) {
    ddata[comida].push($(v).data().info)
  });

  data[dia] = ddata;

  localStorage.setItem('data', JSON.stringify(data));
});

$.each(database, function (i, data) {
  $('<option value="" selected disabled>Seleccione una opción</option>')
  alimentos.append(
    $('<option>', {
      value: i,
      text: data.alimento
    }).data(data)
  )
})

function load() {
  var dia = calendario.datetimepicker('date').startOf('day').unix();
  var data = localStorage.getItem('data');
  if (!data) data = {}; else data = JSON.parse(data);
  var ddata = data[dia];
  if (!ddata) ddata = {
    desayuno: [],
    cmatutina: [],
    comida: [],
    cvespertina: [],
    cena: []
  };
  $.each(ddata, function (i, v) {
    var div = $(`div[name=${i}]`).empty();
    $.each(v, function (i, v) {
      var meal = database[v.comida];
      meal.info = v;
      div.append(
        $('<div class="callout callout-info">').append(
          $('<button class="close" type="button" name="remove">×</button>')
        ).append(
          $('<h5>').text(meal.alimento)
        ).append(
          $('<p>').append(
            $('<div class="input-group">')
              .append(
                $(`<input type="number" class="form-control" value="${v.porciones}">`)
              ).append(
                $('<div class="input-group-append">').append(
                  $('<span class="input-group-text"></span>').text(meal.unidad)
                )
              )
          )
        ).data(meal)
      );
    });
  });
}

