(function () {
  var data = localStorage.getItem('data');
  if (!data) return;
  data = JSON.parse(data);
  var dates = [];
  $.each(data, function (i) {
    var date = new moment.unix(i);
    dates.push(date.toJSON());
  });
  calendario.datetimepicker('markers', dates);
})();